import React from 'react';
import { Link } from 'react-router-dom';

function Contact() {
  return (
    <div style={{ textAlign: 'center', padding: '50px', fontSize: '1.5rem' }}>
      <h1>Contact Page</h1>
      <p>I am abinandhan</p>
       <p>abinandhan@gmail.com</p>
      
    </div>
  );
}

export default Contact;
